import React from "react";
import { Container, Typography } from "@mui/material";
import { CompanyName, Logo } from "./styles";
import ComapnyLogo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <Container sx={{ backgroundColor: "red" }} maxWidth="xl">
      <Logo src={ComapnyLogo} alt="comapny_logo" />
      <Typography fontFamily={"fantasy"} variant="h2" gutterBottom>
        Comapny Name
      </Typography>
    </Container>
  );
}

export default App;
